import React from 'react'
import { Link, useLocation, useNavigate } from 'react-router-dom'

const Home = () => {

    console.log(useLocation().pathname)
    const navigate = useNavigate()

    const pushButton = () => {
        navigate("input_mode")
    }

    return (
        <div>
            <h1>Home</h1>
            <p>

                <button>
                    <Link to={'input_mode'}>入力</Link>
                </button>
                <button onClick={pushButton}>
                過去データ参照{/* <Link to={'input_mode'}>過去データ参照</Link> */}
                </button>
            </p>
        </div>
    )
}

export default Home;
